import React from 'react';  
import {Component} from 'react';  
import './App.css';

const App = () => {
  return (
	<div>	
	< Header />	
	<div>one div</div>	
	<div className="App">
	  <ul>
		<li>html</li>
		<li>js</li>
		<li>css</li>
		<li>react</li>
	  </ul>
	</div>
	</div>
  );
}

const Header = () => {
  return (
	<div>	
	<div>one div</div>	
	<div className="App">
		<a>Home</a>
		<a>News Feed</a>
		<a>Messages</a>
	</div>
	</div>
  );
}

export default App;
